import React from 'react';

const Input = () => {
    return (
        <div>
            <form>
                <input type= "text" placeholder="Username"></input>
                <input type="text" placeholder="What do you think?"></input>
                <button type="submit"></button>
            </form>
        </div>
    );
};

export default Input;
